Let's get into it. Every program needs a starting point, in case of C it is called main. Let's do something simple: a program that does nothing. // this is a comment
void main(void)
{
} So, what can we see here? First thing: a comment is something you can only see in the source code. It is just ignored by literally everything. Second: we see main right? But what's the stuff around it you ask? Well, void means nothing . C is typed, meaning everything has a type. The notation used for declaring things in C is one of the below: Name Declaration Variable type name Array type name[length] Function return_type name(variables) That means we are declaring a function named main (our entry point) that "computes" nothing and needs nothing to do that. Seems about right. Furthermore we have curly braces that denote the function body: the start and end of the function.

