The name of an array without any index given is a pointer to the memory of the array, meaning you can use it to pass arrays to functions (which is otherwise not permitted). This is also nice if you got your memory from somewhere else than an array declaration. Furthermore it means that not only is your array a pointer but also that any pointer is an array. Therefore you can do things like that: // returns the second element
int second(int *arr)
{ // remember that the first index is 0 return arr[1];
} // create an array with two elements (0 and 1)
// and fill it with the values 1337 and 42
int arr[2] = {1337,42}; // store the result (42) of `second` into `snd`
int snd = second(arr);

